description:
Everything you need to shoot stunning outdoor images!

The Essential Guide to Outdoor Photography provides budding photographers with all the advice and inspiration they need to create spell-binging photographs across the three core interests: wildlife, nature and landscapes. You'll also find tips on more challenging areas of outdoor photography including night scenes and various forms of architecture.

The Essential Guide to Outdoor Photography - 3rd Edition
Book Language: English 
Pages: 164
File Type: Pdf
File Size: 62.9 MB

